(1, 'Recognizing Personal Achievement of Employees and their families', '1.png', '<p style=\"overflow-wrap: break-word; margin-bottom: 0px; padding-bottom: 27px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(0, 0, 0);\">On the eve of Republic Day 2019, the&nbsp;<span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">District Boxing Competition&nbsp;</span>was held at Tuticorin.</p><p style=\"overflow-wrap: break-word; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(0, 0, 0);\"><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Mr.&nbsp;</span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Jebastin</span>&nbsp;<span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Balasingh</span><span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">,&nbsp;</span>Branch Manager,&nbsp; Tuticori<span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">n</span>&nbsp;participated in the championship and was declared&nbsp;<span style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: 600; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Champion</span></p><p style=\"overflow-wrap: break-word; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(0, 0, 0);\"><br></p>', '2022-10-01 07:08:37', '2022-10-01 23:36:15'),
(2, 'Recognizing Personal Achievement of Employees and their families', '03.png', '<p style=\"overflow-wrap: break-word; margin-bottom: 0px; padding-bottom: 27px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(0, 0, 0);\">Mr. Anoop Gupta, younger son of Mr. Arun Gupta, DGM Accounts, is a talented artist.</p><p style=\"overflow-wrap: break-word; margin-bottom: 0px; padding-bottom: 27px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(0, 0, 0);\">Without any professional training or guidance, while pursuing his B-Tech in Computer Science, he pursues his passion with zeal and enthusiasm.</p><p style=\"overflow-wrap: break-word; margin-bottom: 0px; padding-bottom: 27px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(0, 0, 0);\">He showcased his painting at the Art Club of NIIT, Neemrana, which received lot of applause and appreciation.</p><p style=\"overflow-wrap: break-word; margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; -webkit-font-smoothing: antialiased; color: rgb(0, 0, 0);\">Glimpses of few paintings by this young &amp; budding talent</p>', '2022-10-07 00:43:45', '2022-10-07 00:43:45');

