(2, 'Envisioning The Future', '<p><span style=\"color: rgb(0, 0, 0); font-family: Poppins;\">In the ensuing years, the organization has planned some avant-garde advancements which it will fructify as part of its ultimate vision. The company is currently on a journey of digital transformation to improve visibility, which has been one of the key concern areas for the customers. It will also be focusing on other vital areas, like multimodal logistics and conversion of road movement to rail movement. Through the latter, it aims to pass on the benefits and advantages of the developing Rail Infrastructure in the country.</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Poppins;\">Furthermore, ALS is in the process of developing AI/ML-based monitoring systems to eliminate/reduce the pilferage/theft in the warehouses. On the environmental front, it is planning to reduce its carbon footprints through eplacing/converting its current fleet to run on greener sources of energy (LNG and Electric Vehicles).</span><span style=\"color: rgb(0, 0, 0); font-family: Poppins;\"><br></span><br></p>', 'warehouse.jpg', '2022-10-01 04:48:33', '2022-10-01 04:48:33');

