INSERT INTO `management` (`id`, `name`, `img`, `description`, `post`, `created_at`, `updated_at`) VALUES
(1, 'RAAJA KANWAR', 'Mr.-Raaja-Kanwar-1365x2048.jpg', '<p><span style=\"color: rgb(0, 0, 0); font-family: Poppins;\">Though the family business ensured a natural progression for Raaja into the tyre business, led by a vision of ‘Nurturing Entrepreneurs through Partnership’ and a passion to forever venture into the unknown, Raaja Kanwar founded Apollo International Limited (AIL). With strong presence in over 45 countries, AIL is into international trading of tyres, manufacturing of high-end leather garments and accessories, international trading of various products and services, EPC &amp; Project Management in developing countries, digital cinema and the wellness industry.</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Poppins;\">In his latest venture, Raaja founded Apollo LogiSolutions Limited (ALS), one of the fastest growing players in the Integrated Logistics Solutions segment. A group company of Apollo International Limited (AIL), ALS was founded the aim of revolutionizing the logistics industry in India by “Nurturing Entrepreneurs through Partnership’.</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Poppins;\">A Management degree holder from Drexel University, USA, Raaja is an avid fitness enthusiast with a passion for nature and wildlife photography. He enjoys exploring new places, cultures &amp; cuisines and trekking in the mountains with his family. Settled in Delhi, he loves to spend his leisure time with his parents, wife and two children.</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Poppins;\">Today, ALS has a significant presence in the integrated logistics space with an established global network in over 100 countries. Under his leadership, ALS has joined the ranks of the most notable companies globally. Recognition by World Economic Forum as “Global Growth Company” and “Best Integrated Logistics Company of the year” at Global Logistics Show in 2017 are testimonies to the evolution trajectory that the organization has traversed over the years.</span><br></p>', 'Vice Chairman & Managing Director Apollo LogiSolutions Limited', '2022-10-01 02:42:41', '2022-10-01 04:05:42');

