(2, '2021', '2021-3.jpg', '<p><span style=\"color: rgb(0, 0, 0); font-family: Poppins; background-color: rgba(37, 58, 96, 0.1);\">Tuticorin CFS, since its inception has been consistently&nbsp;</span><span style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: 600; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; color: rgb(0, 0, 0); background-color: rgba(37, 58, 96, 0.1);\">ranked #1 in the Southern region for 3 years in a row</span><br></p>', '2022-11-07 05:43:39', '2022-11-07 05:43:39'),
