(1, 'About ALS', 'ALS_1.jpg', 'Apollo LogiSolutions or ALS was conceptualised by visionary entrepreneur, Mr. Raaja Kanwar. After gaining insights into the fragmented logistics sector of India, he decided to embrace the opportunity to link the logistics industry’s growth with associated infrastructural development. ALS was thus founded with the aim of professionally revolutionizing the logistics industry’s growth in India by “Nurturing Entrepreneurs Through Partnership”.\r\n\r\nEstablished in the year 2009, ALS facilitates 3PL solutions and end-to-end supply chain services across varied business domains. It enables manufacturers/companies, focus solely on their core operations, without having to bother about supply-chain issues while having real-time access to information on the movement of their goods. Over the years, ALS has evolved as a one-stop logistics solution provider for an array of manufacturers and brands.', '2022-10-06 04:55:00', '2022-10-06 04:55:00');

