 lower-alpha;\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">Long Haul Road Movements including the Full-Truck Load (FTL) and&nbsp;</span><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">Part-Truck Load (PTL) Operations.</span></li><li style=\"padding-left: 10px; border: 0px; font: inherit; vertical-align: baseline; list-style-type: lower-alpha;\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">Long Haul Transportation and Deliveries of 2-wheelers Through&nbsp;</span><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">Specialized Vehicles.</span></li><li style=\"padding-left: 10px; border: 0px; font: inherit; vertical-align: baseline; list-style-type: lower-alpha;\">Last Mile Distribution with Milk-Run Operations.</li></ul><p style=\"padding-left: 10px; border: 0px; font: inherit; vertical-align: baseline; list-style-type: lower-alpha;\"><br></p><p style=\"padding-left: 10px; border: 0px; font: inherit; vertical-align: baseline; list-style-type: lower-alpha;\"><img src=\"data:image/jpeg;base64,\" style=\"width: 501.056px; height: 281.844px;\" data-filename=\"transport1-1536x864.jpeg\"><br></p></div></div>', 'active', '2022-10-01 05:36:16', '2022-10-06 23:28:26');
