(5, 'Liquid Transportation', 'liquid.png', '<p><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; color: rgb(0, 0, 0);\">Apollo Supply Chain provides 3PL Solutions and End-to-End Supply Chain Services across&nbsp;</span><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; color: rgb(0, 0, 0);\">varied industries via a global network of over 100 countries.</span><br></p>', '<p><br></p><p><img src=\"data:image/png;base64,\" style=\"width: 540.643px; height: 315.375px;\" data-filename=\"liquid.png\"><br></p><p><br></p><li style=\"padding-left: 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; list-style-type: lower-alpha; color: rgb(0, 0, 0);\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">ALS and Singapore-based Pacific International Lines (PIL) have</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">formed a Joint Venture for liquid logistics operations in India</span></li><li style=\"padding-left: 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; list-style-type: lower-alpha; color: rgb(0, 0, 0);\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">Movement of all types of non-POL liquids either by rail and road by</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">custom built tank containers</span></li><li style=\"padding-left: 10px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Poppins; vertical-align: baseline; list-style-type: lower-alpha; color: rgb(0, 0, 0);\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">ALS is the first service provider to introduce 28 KL tanks, replacing</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">the then prevalent 26 KL tanks for multimodal transportation of low-</span><br role=\"presentation\"><span dir=\"ltr\" role=\"presentation\" style=\"border: 0px; font: inherit; vertical-align: baseline;\">density chemicals and cost optimization.</span></li>', 'active', '2022-10-06 23:31:20', '2022-10-07 00:03:55');
